CREATE DEFINER=`root`@`localhost` PROCEDURE `sproc_rentlist`()
BEGIN
    SELECT
        A.rentalID,
        A.customerID,
        CONCAT(B.lname, ', ', B.fname, ' ', B.mname) AS Fullname,
        A.carID,
        C.carname,
        C.cartype,
        C.priceperday,
        B.address,
        B.contactno,
        A.driverID,
        D.Fullname AS DriverName,
        D.RatePerHour,
        A.licenseId,
        A.daterented,
        A.datereturn,
        TIMESTAMPDIFF(HOUR, A.daterented, A.datereturn) AS totalhours,
        A.rentalfee,
        CASE 
            WHEN A.driverID IS NOT NULL 
            THEN (CAST(D.RatePerHour AS DECIMAL(10,2)) * TIMESTAMPDIFF(HOUR, A.daterented, A.datereturn))
            ELSE 0
        END AS driverfee,
        A.totalamount,
        A.paymentstatus
    FROM dbcarrental.tblrent A
    INNER JOIN tblcustomer B 
        ON A.customerID = B.customerID
    INNER JOIN tblcar C 
        ON A.carID = C.carID
    LEFT JOIN tbldriver D 
        ON A.driverID = D.driverID
    LIMIT 1000;
END ;;
DELIMITER ;
