CREATE DEFINER=`root`@`localhost` PROCEDURE `sproc_rentsave`(
    IN prentalID VARCHAR(60),
    IN pcustomerID VARCHAR(60),
    IN pcarID VARCHAR(60),
    IN pdriverID VARCHAR(60),
    IN plicenseId VARCHAR(60),
    IN pdaterented DATETIME,
    IN pdatereturn DATETIME,
    IN ptotalhours INT,
    IN prentalfee DECIMAL(10,2),
    IN pdriverfee DECIMAL(10,2),       -- ✅ new
    IN ptotalamount DECIMAL(10,2),    -- ✅ new
    IN ppaymentstatus TINYINT,
    IN pImg LONGBLOB
)
BEGIN
    REPLACE INTO tblrent (
        `rentalID`,
        `customerID`,
        `carID`,
        `driverID`,
        `licenseId`,
        `daterented`,
        `datereturn`,
        `totalhours`,
        `rentalfee`,
        `driverfee`,
        `totalamount`,
        `paymentstatus`,
        `Img`
    )
    VALUES (
        prentalID,
        pcustomerID,
        pcarID,
        pdriverID,
        plicenseId,
        pdaterented,
        pdatereturn,
        ptotalhours,
        prentalfee,
        pdriverfee,       -- ✅ from C#
        ptotalamount,     -- ✅ from C#
        ppaymentstatus,
        pImg
    );
END ;;
